  "91ff22cfdfae4000a6d9": "PCI DSS (Standard Keselamatan Data Industri Kad Bayaran) merupakan standard keselamatan data global untuk industri kad bayaran. Dibangunkan oleh organisasi kad kredit utama seperti Visa, MasterCard, dan American Express, PCI DSS bertujuan untuk melindungi data pemegang kad dan mencegah penipuan, penggodaman, dan kelemahan keselamatan kad kredit.\n\nPCI DSS terdiri daripada 12 syarat keselamatan teras yang merangkumi keselamatan rangkaian, perlindungan data, pengurusan kelemahan, kawalan akses, pemantauan rangkaian, dan dasar keselamatan maklumat. Semua saudagar dan pembekal perkhidmatan yang mengendalikan, menyimpan, atau menghantar maklumat kad kredit mesti mematuhi standard ini.\n\n{brandName} adalah diperakui oleh PCI, menunjukkan bahawa langkah-langkah keselamatan datanya mematuhi standard yang diiktiraf di peringkat antarabangsa. Perakuan ini memastikan perlindungan maklumat kad kredit pelanggan dan data sensitif lain daripada pelanggaran dan penipuan yang berkesan.",
  "91xXw22xZhCYxYVeDdhx4i": "Bilangan maksimum fail yang dimuat naik: {num}.",
  "92eq8vZsMSwqhGko8WYXAy": "Deposit",
  "93515e63f9a64000a1f4": "Keselamatan DNS",
  "93KEpBLkX7fLmtuwVAmBrC": "Di luar julat sasaran",
  "93RVzcYHsLpzdLqoXhjq1b": "<span>Sokongan Terhad dan Pendedahan kepada Ralat:</span> Dompet Web3 biasanya tidak mempunyai sokongan pelanggan yang berdedikasi dan adalah terdedah kepada ralat pengguna, seperti menghantar dana ke alamat yang salah. Ia juga sering tidak mempunyai perkhidmatan penukaran fiat-ke-kripto yang langsung.",
  "93a9284459b84000a20f": "Kadar Peratusan Tahunan (APR) Maksimum: {apr}",
  "93bamwKq383WFycaKTMQEd": "Akaun tidak boleh digabungkan selepas pemadaman. Jika anda ingin menggabungkan akaun, hubungi <a href='{a}' target='_blank' rel='noopener noreferrer'>Khidmat Pelanggan</a>.",
  "94HZ4AG61AYiY8N7PidjXH": "Apabila terlibat dalam dagangan salinan kripto, anda masih perlu peka terhadap risiko sistematik yang menjejaskan seluruh pasaran, seperti perubahan peraturan atau acara global utama. Faktor-faktor ini boleh memberi kesan kepada setiap mata wang kripto, termasuk yang terdapat dalam portfolio anda. Dengan mencerminkan strategi individu lain, anda bukan sahaja terdedah kepada risiko membuat keputusan mereka, tetapi juga kepada dinamik pasaran yang lebih luas ini. Sebagai contoh, peralihan peraturan secara tiba-tiba atau isu penting dengan bursa kripto utama boleh amat menjejaskan keadaan pasaran, memberi kesan kepada pelaburan anda. Oleh itu, ia adalah penting untuk anda mempelbagaikan portfolio dan strategi dagangan anda untuk mengagihkan risiko.",
  "969274b779d14000ab7b": "Sandaran dan Pemulihan Data",
  "96ae3df671f24000ab05": "{brandName} menggunakan algoritma penyulitan yang dipilih dengan teliti dan kukuh untuk memastikan bahawa semua komunikasi adalah dilindungi daripada penyadapan atau usikan pihak ketiga yang tidak dibenarkan. Ini termasuk algoritma pertukaran kekunci yang menyokong kerahsiaan hadapan seperti ECDHE (Elliptic Curve Diffie-Hellman Ephemeral), dan algoritma penyulitan simetri seperti AES (Standard Penyulitan Lanjutan) dan ChaCha20. Algoritma ini adalah diiktiraf di peringkat global untuk keselamatannya yang terbukti dari semasa ke semasa.\n\n{brandName} memantau dan mengemas kini langkah-langkah keselamatannya secara berterusan untuk menangani ancaman siber yang semakin berkembang. Audit keselamatan kami yang kerap memastikan bahawa amalan keselamatan kami memenuhi atau melebihi standard industri. Keselamatan pengguna kami merupakan keutamaan tertinggi kami, dan {brandName} komited untuk menyediakan persekitaran dagangan yang selamat dan mudah. Kepercayaan anda merupakan penggerak di sebalik kemajuan {brandName} yang sentiasa berkembang.",
  "96oo8Yq5o389Qt4hNRmqty": "Edit Pesanan",
  "9714bcf9f64d4000a55b": "Pasukan tindak balas insiden profesional kami menguruskan isu keselamatan 24/7 dengan prosedur yang mantap. Kami meramalkan masalah yang berpotensi, bertindak balas dengan serta-merta, dan menjalankan semakan pascainsiden untuk memastikan tindak balas kecemasan yang berkesan.",
  "97rDn5c8r9axPurnUZSTRp": "Manfaatkan kitaran halving Bitcoin dengan {brandName}. Sama ada anda beli atau jual Bitcoin di pasaran semerta, buka panjang atau buka pendek Bitcoin dengan memanfaatkan kemeruapannya, atau pilih untuk menjana pendapatan pasif pada Bitcoin anda yang tidak digunakan, platform {brandName} yang kukuh menjamin pengalaman dagangan yang selamat di pasaran.",
  "98acee1e18524000af2e": "{brandName} telah menubuhkan protokol keselamatan yang terperinci untuk sambungan API, pengesahan, perlindungan data, pengesahan input/output, dan pengehadan kadar.",
