  "99k7WVk3eymfiacNiM2JLv": "<span>Kekunci Awam:</span> <a href='{url}' target='_blank'>Kekunci awam</a> anda adalah serupa dengan alamat dompet anda. Anda boleh berkongsinya untuk menerima dana atau menggunakan aplikasi terdesentralisasi (<a href='{dappsurl}' target='_blank'>dapp</a>). Ia adalah dijana daripada kekunci peribadi, tetapi tidak dapat mendedahkan atau menyimpulkan <a href='{url2}' target='_blank'>kekunci peribadi</a> anda.",
