  "9Vg9Ye1NshSRtk2XPYyH3c": "Anda boleh melihat statistik kolam perlombongan dengan melayari laman web kolam dan mengakses papan pemuka mereka. Papan pemuka ini memberikan maklumat tentang kadar hash, pendapatan, dan statistik berkenaan anda yang lain.",
