  "9YRzfJQkHpD1ADcF5vJd2h": "Sebab pembekuan aset sedang diproses. Kami akan memaklumkan anda dengan segera.",
  "9b49625b13694000aa6f": "Sistem keselamatan akaun {brandName} terdiri daripada dua bahagian: pengesahan dan kawalan risiko. Protokol kawalan risiko kami menggunakan strategi anti-pancingan data untuk pelbagai senario seperti log masuk, pengeluaran, dan untuk perubahan dalam tetapan keselamatan. Ia menilai peranti, alamat IP, dan tingkah laku masa lalu pengguna untuk menilai potensi risiko. Jika risiko dikesan, langkah-langkah pengesahan tambahan akan dimulakan berdasarkan senario tertentu untuk memastikan akaun selamat.",
  "9bb956f7b7d74000a302": "Mengurus ID Peranti",
  "9bedd0200f824000a39c": "{brandName} mempunyai platform yang bersatu untuk mengurus dan menganalisis log operasi dan keselamatan. Ini memastikan bahawa semua tingkah laku dan aktiviti adalah direkodkan secara kekal untuk memenuhi syarat pengawalseliaan, membolehkan pemantauan, menyokong penyiasatan, dan memastikan kebolehkesanan.",
  "9c8y9d4F1bQeRBQGpSwrj1": "Telah Disimpan",
  "9cbbe23037a94000a595": "Langkah-langkah pencegahan kebocoran data adalah dilaksanakan untuk secara automatiknya mengenal pasti maklumat sensitif, dan memintas atau memaklumkan kami tentang sebarang penghantaran data yang tidak dibenarkan.",
