  "9hK2i7qu9ucJ4grAZRAByv": "<span>Pertimbangkan Lokasi dan Kependaman:</span> Pilih kolam yang mempunyai kependaman yang rendah dan jarak geografi yang lebih dekat untuk kecekapan perlombongan yang lebih baik.",
