  "9r6dNa5PHiS643bYDiZV4m": "Gerbang Anda ke DeFi, dapp, dan NFT",
  "9vJtKFry8Q1xpq2TjbPG4x": "Bergantung semata-mata kepada pedagang yang disalin untuk pelaburan kripto anda boleh membahayakan. Pertama sekali, strategi mereka mungkin tidak sejajar dengan toleransi risiko dan matlamat anda. Sesetengah strategi mungkin juga mempunyai insentif (seperti faedah atau yuran dagangan yang lebih rendah) yang menyebabkan mereka mengutamakan perolehan pengikut berbanding amalan dagangan yang lestari dan tempoh panjang yang sesuai dengan objektif kewangan anda.",
  "9vZMJ91Rea72iuDjqm7zrD": "Pesanan TWAP",
  "9ybg8nNsJNUCDkcPwV8ncf": "Penciptaan dompet Web3 merupakan proses yang mudah. Berikut merupakan panduan langkah demi langkah untuk membantu anda menyediakan dompet Web3 anda sendiri:",
  "9z4QEvBgJkU2aVy8gEFXHV": "Koin",
  "KuCard": "KuCard",
  "a34084aa796d4000af37": "Akaun Margin Terisolasi Kekerapan Tinggi",
  "a3ad8ebe7d904000af8e": "Apabila pengguna mencipta API atau mengakses halaman pengurusan API, pengeluaran hanya boleh dibuat daripada alamat IP pengguna dan alamat pengeluaran tertentu. Ini secara berkesannya mengurangkan risiko pelanggaran keselamatan sekiranya kekunci API terdedah atau hilang.",
  "a4HWeqMA3NNtUsRPtDwQov": "Jika harga {coin1} adalah sama dengan atau di bawah {protectPrice}, anda akan menerima {num} {coin1}.",
  "a5dd634a700a4000ae11": "Artikel pertama",
  "a5tsFk78WLBMjP7PL518CL": "Cukai",
  "a6QD5WPJNKRezS4vxBbsHb": "Rangkaian Deposit:",
  "a775e0c384f34000a3a8": "{brandName} melaksanakan pengasingan kebenaran untuk KPI pengguna, termasuk kebenaran umum, dagangan semerta, margin, dan niaga hadapan. Tahap kebenaran yang berbeza sepadan dengan operasi yang berbeza, menghalang tindakan kebenaran silang. Untuk mengubah kebenaran, pengguna mesti log masuk ke akaun mereka terlebih dahulu, menjamin keselamatan dana mereka.",
  "a7P3fAoqk4dH8uaFvzj6Kq": "Minimum: {rate}",
  "a840f10cc4cf4000a46e": "Kekunci API dan Pengasingan Akaun",
  "a8TpUFNDSYShm4cRjT5y1b": "Ketahui Lebih Lanjut",
  "a8c95b5ee1ea4000aebf": "Melindungi privasi data pengguna merupakan keutamaan kami. {brandName} menggunakan langkah-langkah keselamatan lanjutan untuk memastikan kerahsiaan data dan menghalang akses yang tidak dibenarkan. Data sensitif, termasuk kata laluan, kekunci transaksi, dan maklumat pengenalan peribadi, adalah dilindungi dengan menggunakan langkah-langkah yang paling ketat. Data ini adalah diproses dengan kaedah bukti tanpa pengetahuan, memastikan bahawa platform pun tidak boleh mengakses maklumat ini tanpa kebenaran pengguna yang jelas. Selain itu, semua data sensitif adalah disulitkan dengan menggunakan algoritma penyulitan lanjutan untuk meningkatkan lagi keselamatan.\n\nPlatform menggunakan sistem pangkalan data khusus yang direka khas untuk menyimpan maklumat sensitif, menyediakan lapisan keselamatan tambahan. Oleh itu, pangkalan data ini beroperasi dalam persekitaran rangkaian dalaman yang dikawal dengan ketat. Kaedah kontena kemudiannya memastikan bahawa setiap perkhidmatan berjalan dalam bekas yang berasingan, memisahkan perkhidmatan dengan tahap pengasingan. Pendekatan ini menjamin bahawa meskipun dalam platform, perkhidmatan tidak boleh mengakses silang data sensitif. Keselamatan data yang dilakukan dengan cara ini sekali gus memastikan platform stabil dan boleh diskala.",
  "a8oyZqZr6dz72wSfrpqKCc": "Asas",
  "a9b72c3a46494000a10c": "1. Kami bekerjasama dengan institusi berlesen dan kerap mengumpulkan dana ke dalam akaun bank institusi yang boleh dipercayai untuk menjamin keselamatan dana pengguna.\n2. Sahkan bahawa nama akaun pendeposit adalah sepadan dengan akaun pengguna untuk mengelakkan risiko penipuan dan pematuhan.\n3. Sahkan bahawa nama akaun penerima adalah sepadan dengan akaun pengguna untuk pengeluaran untuk mengelakkan risiko penipuan dan pematuhan.\n4. Semua transaksi deposit dan pengeluaran memerlukan pelengkapan pengesahan KYC (Kenali Pelanggan Anda) terlebih dahulu.",
  "a9dae303ab5e4000a56d": "Kata laluan dan data sensitif lain tidak boleh diakses tanpa kebenaran pengguna yang jelas. {brandName} menggunakan pengesahan yang ketat untuk semua permintaan dalaman, memastikan hanya perkhidmatan yang dibenarkan boleh bertukar-tukar data. Kawalan akses berasaskan peranan (RBAC) mengehadkan akses kepada data sensitif untuk operasi yang diperlukan, menghalang pengguna dan perkhidmatan yang dibenarkan daripada melebihi kebenaran mereka.\n\nUntuk keselamatan tambahan, kami kerap menjalankan audit keselamatan dan imbasan kelemahan untuk memastikan semua sistem mematuhi standard terkini dan amalan terbaik. Pasukan keselamatan {brandName} memantau ancaman yang muncul dengan teliti, bertindak balas dengan cepat terhadap sebarang kemungkinan insiden. Akhir sekali, pekerja juga menerima latihan keselamatan tetap untuk mengekalkan amalan keselamatan harian yang terbaik.\n\nMemandangkan kepercayaan anda adalah amat penting bagi kami, {brandName} komited untuk melindungi privasi dan keselamatan data pengguna. Kami sentiasa meningkatkan langkah-langkah keselamatan kami dalam perlindungan yang lebih baik daripada ancaman siber yang semakin canggih. Langkah-langkah ini bertujuan untuk menyediakan persekitaran dagangan yang selamat, membolehkan pengguna kami menjalankan dagangan dengan yakin dan selamat.",
  "aApGRSgeJCTYLv5ik31mgx": "Strategi",
  "aCBJGNohUwX9MSfFa7MmvQ": "3 bulan yang lalu (tidak termasuk hari ini)",
