  "aboutus.feature3": "KCS Membuka Ekosistem {brandName}",
  "aboutus.feature3.intro": "Kami sedang membangunkan ekosistem di sekitar Token {brandName} (KCS), yang akan menjadi panduan anda dalam dunia terdesentralisasi yang berkembang maju yang telah dibina bersama oleh semua ahli komuniti {brandName}.",
  "aboutus.press": "Media Massa",
  "aboutus.story": "Kisah Kami",
  "aboutus.story.intro": "Di sebalik {brandName} adalah dua orang pakar teknologi yang merupakan pengguna terawal blok rantai. Setelah memulakan pengekodan pada usia 8 tahun dan mengasaskan bisnes pertamanya pada usia 16 tahun, Michael dengan segeranya mula melombong BTC selepas dia mendengar tentang Bitcoin daripada bosnya Eric pada tahun 2012. Namun apabila dia cuba menjual beberapa BTC di Mt.Gox, beliau mendapati bahawa apa yang dikenali sebagai platform terbesar di dunia pada masa itu adalah sukar untuk digunakan oleh seorang pemula. Selaras dengan penggunaan blok rantai yang makin berleluasa, Michael dan Eric menyedari bahawa ia sedang membentuk semula sistem kewangan di mana ia menjadi satu sistem yang bukan sahaja akan memberi perkhidmatan kepada segelintir golongan terkaya, tetapi semua orang di dunia — mahupun mereka yang kurang berpendidikan, menganggur, dan tidak mempunyai akaun bank. Menjelang akhir tahun 2013, mereka menulis bahagian pertama kod {brandName} di sebuah kafe, memulakan Bursa Rakyat yang akan membolehkan semua terlibat dengan kripto.",
