  "asset.faq.answer.oneNew": "Akaun Pendanaan adalah digunakan untuk membuat deposit, pengeluaran, dan pembelian kripto melalui kad kredit/debit, serta beri pinjaman margin. Akaun Dagangan adalah digunakan untuk menjalankan dagangan kripto. Akaun Margin adalah digunakan untuk menjalankan peminjaman dan dagangan margin. Akaun Niaga Hadapan adalah digunakan untuk menjalankan dagangan niaga hadapan. Akaun Kewangan adalah digunakan untuk taruhan dan pengurusan kewangan, dengan hasil tahunan sehingga 20%.",
