  "assets.por.audit.intro.info": "Aset pada jam {auditTime} UTC+8 telah disulitkan dan diagregatkan kepada sebatang pokok Merkle. Data aset akaun semasa merupakan daun Merkle. Selagi akar Merkle kekal tidak berubah, aset yang sepadan dengan daun Merkle tidak boleh diusik.",
  "assets.por.audit.intro.title": "Catatan",
