  "assets.por.audit.progress": "Proses Audit",
  "assets.por.audit.progress.content1": "Pada titik masa yang tetap, semua aset pengguna akan diambil gambar, disimpan, dan disulitkan. Pegawai pengesahan akan memastikan bahawa setiap aset pengguna adalah disertakan.",
  "assets.por.audit.progress.content2": "Hash dan baki UID setiap pengguna akan membentuk daun Merkle, manakala jumlah semua aset pengguna akan membentuk pokok Merkle. <br/> Sebaik sahaja pokok Merkle dijana, sebarang pengubahsuaian akan dikenalpasti.",
  "assets.por.audit.progress.content3": "Pada titik masa gambar diambil, setiap jenis alamat yang boleh disahkan sepadan aset dan ketinggian bloknya.<br/>\nTerdapat juga kaedah khas untuk mengesahkan pemilikan alamat dompet.",
