  "assets.por.audit.verify.content1": "Sila ambil perhatian bahawa faktor-faktor seperti masa gambar diambil dan aset akaun yang diperbadankan akan menyebabkan perbezaan dengan aset akaun semasa anda.",
  "assets.por.audit.verify.content2": "Pengesahan diluluskan. Aset pengguna telah disimpan dan dilindungi dengan selamat.<br/>\nMemandangkan semua orang boleh mengambil bahagian dalam pengesahan, jumlah keseluruhan aset para pengguna di platform adalah boleh dipercayai.",
  "assets.por.audit.verify.content3": "Aset dalam rantaian yang tulen dan kalis usikan.",
