  "assets.por.audit.verify.title4": "Sahkan rizab",
  "assets.por.currency.reserveRate": "Nisbah Rizab {currency}",
  "assets.por.desc.auditDate": "Masa gambar aset diambil: {auditDate} UTC+8",
  "assets.por.desc.content": "Sekiranya terdapat perbezaan antara jumlah dalam gambar aset anda dan jumlah yang dipaparkan dalam akaun anda, ia berkemungkinan disebabkan oleh perkara-perkara berikut:\n<br/>1. Bagi Akaun Margin, gambar hanya mengambil kira ekuiti bersih. Aset yang dipinjam adalah tidak termasuk dalam gambar manakala aset yang telah dipinjam keluar adalah termasuk dalam gambar.\n<br/>2. Bagi Akaun Niaga Hadapan, aset gambar adalah tidak termasuk untung/rugi (PNL) yang belum terealisasi.\n<br/>3. Bagi aset {brandName} Untung, ETH2 adalah diperoleh apabila ETH ditukarkan secara sukarela kepada ETH2 oleh pengguna, yang berbeza daripada ETH dan justeru tidak termasuk dalam gambar aset.",
  "assets.por.desc.scope": "Skop gambar aset: {scope}",
  "assets.por.detail.view": "Lihat butiran pengesahan",
  "assets.por.faq.merkle.title": "I. Deskripsi Pokok Merkle yang Disediakan oleh {brandName}",
  "assets.por.faq.merle.node.codedemo": "Contoh: {code}.",
  "assets.por.faq.merle.node.desc": "Maklumat yang disimpan dalam setiap nod termasuk:<br/>\n1. Nilai hash: nilai hash nod.<br/>\n2. Baki: jumlah mata wang kripto yang ditangkap dalam gambar aset pengguna (menggunakan BTC, ETH, USDT, dan USDC sebagai contoh).",
  "assets.por.faq.merle.node.format": "Format: nilai hash, \\{\"BTC\":\"Jumlah BTC\", \"ETH\":\"Jumlah ETH\", \"USDT\":\"Jumlah USDT\", \"USDC\":\"Jumlah USDC\"\\}.",
  "assets.por.faq.merle.node.info": "Maklumat Nod",
  "assets.por.faq.merle.rule.code": "Sebagai contoh: {code}. Catatan: sifar di belakang sebelah kanan titik perpuluhan adalah diabaikan.",
  "assets.por.faq.merle.rule.desc": "1. Nod Daun (Nod Pemadatan Dikecualikan)<br/>\n<div>\n<span class=\"por_faq_desc\">\nhash=SHA256(nonce+baki). {brandName} akan memberikan nonce yang unik kepada setiap pengguna. \"Baki\" merupakan rentetan JSON yang terdiri daripada jumlah mata wang kripto yang termasuk dalam gambar aset pengguna.</span></div>",
  "assets.por.faq.merle.rule.fill": "2. Nod Pemadatan<br/>\nUntuk membina sebatang pokok Merkle (pokok binari yang penuh), 2^n set data nod daun adalah diperlukan. Walau bagaimanapun, bilangan sebenar blok data mungkin bukan 2^n malah ia mungkin merupakan bilangan ganjil. Dalam kes sedemikian, jika nod k tidak mempunyai nod adik-beradik, pemadatan akan ditambah secara automatik dengan menghasilkan satu nod adik beradik k', di mana hash(k')=hash(k). Nilai jumlah untuk semua jenis mata wang kripto bagi nod k' adalah semuanya sifar. Ini boleh dilihat dalam Nod4, yang berwarna hijau, dalam Rajah 1.",
  "assets.por.faq.merle.rule.parent": "3. Nod Induk <br/>\n<div><span class=\"por_faq_demo\">\nhash=SHA256(h1 + h2 + (rentetan JSON untuk baki h1 + baki h2) + ketinggian).\n</span><br/>\nh1 = hash nod anak kiri nod semasa. h2 = hash nod anak kanan nod semasa. ketinggian = ketinggian nod semasa.\nDefinisi ketinggian nod dalam pokok: ketinggian nod daun bawah = 1; ketinggian nod induk = ketinggian nod anak + 1; ketinggian bagi nod akar adalah yang terbesar.\n</div>",
  "assets.por.faq.merle.rule.title": "Pengiraan Hash",
  "assets.por.faq.merle.theory.demo": "Data JSON Laluan Merkle:",
  "assets.por.faq.merle.theory.desc": "Berdasarkan definisi pokok Merkle, kita akan bermula pada nod daun pengguna dan mengira nilai hash nod induk secara ke atas sehingga kita memperoleh hash(akar) bagi nod akar. Kemudian, kami akan membandingkan nilai ini dengan nilai hash nod akar laluan Merkle. Jika kedua-dua adalah sepadan, maka pengesahan akan lulus; jika tidak, pengesahan akan gagal.<br/>\nBerdasarkan pokok Merkle dan data JSON di bawah, para pengguna boleh mengira nilai hash untuk Nod 5 berdasarkan nod daun (Nod 2) mereka sendiri dan maklumat untuk nod bersebelahan (Nod 1). Nilai hash Nod 5 kemudiannya akan digunakan bersama-sama dengan maklumat untuk nod bersebelahan (Nod 6) untuk mengira hash nod induk (Akar). Kemudian, bandingkan nilai yang terhasil dengan maklumat nod akar yang disediakan dalam data laluan Merkle untuk melengkapkan proses pengesahan.",
  "assets.por.faq.merle.theory.title": "II. Pengesahan Pokok Merkle",
  "assets.por.faq.merle.verify.error": "(2) Jika data anda adalah salah, keputusan akan menunjukkan \"Pengesahan laluan pokok Merkle gagal\".",
  "assets.por.faq.merle.verify.ok": "(1) Jika data anda adalah betul, keputusan akan menunjukkan \"Pengesahan laluan pokok Merkle lulus\".",
  "assets.por.faq.merle.verify.self": "Anda juga mempunyai pilihan untuk menulis sendiri program untuk mengesahkan data laluan yang diperoleh dalam Langkah 1 dan mengesahkan bahawa aset anda adalah termasuk dalam pokok Merkle yang dijana dalam audit ini.",
  "assets.por.faq.merle.verify.step1": "1. Salin dan tampal kod sumber di bawah kepada mana-mana IDE Python atau pentafsir Python, klik \"Jalankan\".",
  "assets.por.faq.merle.verify.step1.desc": "1) Salin dan tampal kod sumber kepada mana-mana IDE Python atau pentafsir Python yang anda gemari. Anda juga boleh menggunakan alat dalam talian berikut: <a href='https://www.online-python.com/' target='_blank' rel='noopener noreferrer'>https://www.online-python.com/</a> (kosongkan kod yang ditunjukkan dalam kotak teks sebelum menampal kod sumber).",
  "assets.por.faq.merle.verify.step1.run": "2) Pastikan kod sumber adalah ditampal dengan sepenuhnya dalam kotak teks. Jalankan kod tersebut, anda sepatutnya akan melihat permintaan berikut: \"Sila masukkan data yang akan disahkan:\" dalam tetingkap terminal.",
  "assets.por.faq.merle.verify.step2": "2. Salin data pokok Merkle.",
  "assets.por.faq.merle.verify.step3": "3. Tampal data pokok Merkle yang telah anda salin ke dalam terminal. Kemudian tekan masukkan.",
  "assets.por.faq.merle.verify.step4": "4. Lihat keputusan:",
  "assets.por.faq.merle.verify.title": "III. Langkah Pengesahan",
  "assets.por.faq.title": "Cara untuk Mengesahkan Aset Dengan Menggunakan Pokok Merkle",
  "assets.por.intro.content1": "PoR merupakan kaedah yang digunakan secara meluas untuk membuktikan jagaan aset di blok rantai. Ini bermakna {brandName} mempunyai dana yang meliputi semua aset pengguna pada buku kami.",
  "assets.por.intro.content2": "Struktur data pokok Merkle adalah digunakan untuk menjana dan menyulitkan data aset pengguna dengan selamat ke dalam hash tunggal, yang berfungsi sebagai \"ringkasan\" bagi semua data yang dimasukkan. Ciri kalis usikan dan boleh dikesan data pokok Merkle membolehkan para pengguna untuk mengesahkan kebolehpercayaan data dengan mudah.\nPara pengguna boleh mengesahkan pemilikan alamat dompet dalam rantaian dan jumlah keseluruhan aset dompet.\nPara pengguna juga boleh mengesahkan rizab aset platform dengan membandingkan jumlah aset pengguna bursa dengan jumlah aset yang terdapat dalam alamat dompet dalam rantaian yang diterbitkan.",
  "assets.por.intro.content3": "Pokok Merkle adalah dijana dengan menggunakan data aset semua pengguna. Dengan menggunakan pokok Merkle, pengguna boleh mengesahkan sama ada data aset mereka wujud dalam pokok Merkle. Sekiranya data wujud di pokok Merkle, juruaudit boleh mengesahkan bahawa aset pengguna adalah dipegang dan disimpan dengan selamat di platform, dan telah dimasukkan ke dalam PoR (Bukti Rizab).",
  "assets.por.intro.content4": "Pokok Merkle adalah dijana dengan menggunakan data aset semua pengguna. Dengan menggunakan pokok Merkle, pengguna boleh mengesahkan sama ada data aset mereka wujud dalam pokok Merkle. Sekiranya data wujud di pokok Merkle, juruaudit boleh mengesahkan bahawa aset pengguna adalah dipegang dan disimpan dengan selamat di platform, dan telah dimasukkan ke dalam PoR (Bukti Rizab).\nIni boleh dilakukan dengan:\n1. Menggunakan agensi bebas pihak ketiga untuk mengesahkan keputusan audit.\n2. Memuat turun fail dari halaman butiran dan menggunakan kod awam kami untuk pengesahan dengan alat dalam talian bebas.",
  "assets.por.intro.title1": "Apakah itu PoR (Bukti Rizab)?",
