  "assets.withdraw.fees": "Yuran",
  "assetsBack.cs.airCoin.applyDes": "Sila semak butiran permintaan anda. Sebaik sahaja diluluskan, kami akan memaklumkan anda tentang yuran perkhidmatan yang berkenaan, di mana ia akan ditolak daripada Akaun Pendanaan anda untuk melengkapkan proses pemulihan aset. <br>Jika aset anda tidak dapat dipulihkan, atau jika sebab kegagalan deposit bukan merupakan kesilapan di pihak anda, tiada yuran akan dikenakan. Jika anda bersetuju dengan syarat-syarat ini, klik pada Sahkan dan kami akan meneruskan dengan permintaan anda.",
  "assetsBack.cs.airCoin.reason1": "<span>Jika rangkaian blok rantai bagi mata wang kripto yang didepositkan adalah tidak disokong di {brandName}, atau <span class='{style}'>jika mata wang kripto yang telah anda depositkan adalah tidak tersenarai atau dinyahsenarai di {brandName}</span>, deposit tidak akan dikreditkan.</span>",
  "assetsBack.cs.airCoin.reason2": "<span>Untuk keselamatan dana anda, <span class='{style}'>kami hanya boleh mengembalikan deposit anda ke alamat blok rantai yang asal sebaik sahaja ia diluluskan, dan TxID bayaran balik akan diberikan. Jika anda mempunyai sebarang keadaan khas, sila hubungi sokongan pelanggan rasmi kami di support@kucoin.com.</span> Jika sumber alamat deposit merupakan platform yang lain, sila hubungi platform masing-masing untuk meneruskan dengan beberapa langkah yang seterusnya sebaik sahaja kami telah melengkapkan bayaran balik di pihak kami.</span>",
  "assetsBack.cs.airCoin.title": "Deposit yang dibuat dengan menggunakan rantaian yang tidak disokong/koin yang tidak tersenarai",
  "assetsBack.cs.refundAddress.title": "Alamat Bayaran Balik",
