  "assetsBack.form.errMsg5": "Format tidak sah. Hanya fail {type} yang disokong.",
  "assetsBack.form.tips1": "Untuk keselamatan dana anda, <span class='{style}'>kami hanya boleh mengembalikan dana yang telah anda depositkan ke alamat sumber tanpa sebarang memo, tanda, atau pesanan.</span> Jika alamat sumber deposit dimiliki oleh satu platform, hubungi platform tersebut untuk mendapatkan bantuan lanjut selepas KuCoin mengembalikan dana anda. Jika terdapat keadaan istimewa, hubungi kami di support@kucoin.com.",
  "assetsBack.form.tips2": "Catatan: Untuk melindungi aset anda, kami hanya boleh mengembalikan dana yang telah dipulihkan ke alamat sumber deposit asal (iaitu, kembali ke alamat dari mana ia dihantar pada blok rantai). Untuk sebarang keadaan istimewa, sila hubungi Khidmat Pelanggan kami di support@kucoin.com. Jika alamat pengembalian merupakan alamat dompet panas yang dimiliki oleh platform lain, anda akan perlu menghubungi platform tersebut untuk mendapatkan bantuan tambahan sebaik sahaja proses bayaran balik di pihak kami selesai.",
  "assetsBack.form.tooltip1": "Sila pilih koin yang telah didepositkan daripada menu lungsur. Jika anda tidak menjumpai koin anda, masukkannya secara manual.",
  "assetsBack.reason1": "Terlupa untuk menyatakan atau telah menyatakan Tanda/Memo yang salah semasa membuat deposit.",
  "assetsBack.reason1.confirmModelDes": "Sila sahkan bahawa maklumat dalam permohonan anda adalah betul. Sebaik sahaja permohonan anda telah diluluskan, kami akan memaklumkan anda untuk membayar yuran yang sepadan. Selepas permohonan anda selesai, kami akan memberikan anda TxID bagi deposit yang telah dikembalikan.",
  "assetsBack.reason1.des1": "Untuk mata wang kripto tertentu seperti XLM, EOS, dan XRP, tanda atau memo mestilah diisi sepanjang proses deposit. Jika anda tidak memasukkan kedua-dua alamat dan tanda dengan betul, deposit akan gagal.",
  "assetsBack.reason1.des2": "Untuk keselamatan dana anda, <span class='{style}'>kami hanya boleh mengembalikan dana yang didepositkan ke alamat sumber tanpa sebarang memo, tanda, atau pesanan. TxID bagi dana yang dikembalikan akan diberikan.</span> Jika alamat sumber deposit adalah dimiliki oleh platform lain, anda akan perlu menghubungi mereka untuk mendapatkan sokongan lanjut sebaik sahaja kami telah melengkapkan proses pengembalian di pihak kami. Jika anda mempunyai sebarang keadaan istimewa, hubungi kami di support@kucoin.com.",
  "assetsBack.reason1.des3": "Jika anda secara tidak sengajanya menyatakan tanda atau memo yang dimiliki oleh pengguna lain, dana anda mungkin telah didepositkan ke dalam akaun mereka. Dalam keadaan sedemikian, maaf, kami tidak dapat memberikan bantuan lanjut.",
