  "bJSGSzQJPofcxucs9NZe4P": "Dijangka pada akhir tahun 2023 atau awal tahun 2024, <a href='{url}' target='_blank'>penaiktarafan Ethereum Dencun</a> adalah ditetapkan untuk membawa peningkatan kebolehskalaan dan ciri baharu, berdasarkan perkembangan yang dibuat oleh pengemaskinian yang sebelumnya. Komponen utama bagi penaiktarafan ini ialah EIP-4844, di mana ia akan memperkenalkan 'blobs'—sejenis transaksi baharu pada rangkaian Ethereum. Perkembangan ini bertujuan untuk mengurangkan bayaran gas secara drastik sebanyak 10 hingga 100 kali ganda, dengan kebolehskalaan tambahan.",
  "bLkxqRaowWd4Up7HzmHJVw": "Dalam pasaran mata wang kripto, terutamanya dengan altcoin yang baru muncul, sekatan kecairan boleh membawa kepada slippage yang ketara. Ini boleh menyukarkan pedagang untuk melaksanakan pesanan pada harga sasaran mereka, terutamanya sepanjang tempoh kemeruapan pasaran.",
  "bLu6VUUji7ifa2ZDQSBEnc": "<span>Ciri Saling Kendali dan Inovasi:</span> Banyak dompet Web3 adalah boleh saling kendali merentasi rangkaian blok rantai yang berbeza dan sering menerapkan inovasi blok rantai yang terkini lebih pantas daripada dompet bursa berpusat.",
  "bMcczrCNBsKFXkR9ZZ7cSi": "Kadar Peratusan Tahunan (APR) turun naik setiap hari, dan anggaran pulangan adalah untuk rujukan sahaja.",
  "bMukGAeEpmmc11EuPQiguW": "Trend Menurun",
  "bQ4uR2zuHgztycrj5JZjAu": "Petua Keselamatan Terbaik untuk Dompet Web3 Anda",
  "bQaSgeGUJnRMHeAskjU89J": "Anggaran Pulangan",
  "bQcvmNzMXKk2oiNh6dTK3u": "Mata wang kripto bukti kerja (PoW) seperti Bitcoin menggunakan sistem automatik untuk mengekalkan kadar penerokaan blok yang stabil. Sistem ini melaraskan kesukaran perlombongan berdasarkan persaingan antara pelombong.",
  "bQnSQBRj74n4fXqQHBfg4g": "Hasil Peratusan Tahunan (APY) Beri Pinjaman Semasa",
  "bS1qMG8qhDQF2Jzh3JSaMd": "Bagaimanakah cara saya membeli NFT dengan menggunakan dompet Web3?",
  "bSAMsQ9WDoKrKyAcYKirSK": "Pertaruhan ETH Saya",
  "bTNHKimggRnp528LQwXLmd": "Halaman Utama Bot",
  "bTPJiUVFS93Ea3vBeRwWuD": "Transaksi pada blok rantai memerlukan <a href='{url}' target='_blank'>yuran rangkaian</a> (selalunya dalam mata wang kripto asli blok rantai). Yuran ini memberi pampasan kepada <a href='{minerurl}' target='_blank'>pelombong</a> atau <a href='{validatorurl}' target='_blank'>pengesah</a> untuk memproses dan melindungi transaksi.",
  "bTo6uFEz432SLtKsnXG5QB": "Masukkan apa-apa maklumat tambahan",
  "bUKPBttvPNfp4edXm7SRMe": "Memandangkan jumlah pegangan anda adalah di bawah jumlah minimum yang diperlukan, tiada keuntungan akan dijana. Sila tebus semua pegangan anda.",
  "bUjLZapfTi5f3bXrNf3gy7": "Semak <span class='highlight'>Folder Spam atau Junk</span> anda.",
