  "beginnerZone.rule.item1": "1. Acara bermula pada {date} dan berlangsung untuk masa yang terhad.",
  "beginnerZone.rule.item2": "2. Daftar untuk perolehi satu kotak misteri dan menangi sehingga {num1} USDT. Pengguna baharu yang telah berjaya mendaftar di {brandName} sepanjang acara berlangsung sahaja yang layak. Selepas mendaftar, pengguna baharu menerima satu peluang untuk menangi kotak misteri yang bernilai sehingga {num2} USDT.",
  "beginnerZone.rule.item3": "3. Lengkapkan deposit pertama/pembelian kripto anda dan menangi sehingga {num1} USDT. Pengguna yang tidak pernah mendepositkan atau membeli kripto di {brandName} sebelum acara berlangsung sahaja yang layak. Pengguna yang mempunyai jumlah deposit pertama/pembelian kripto yang bernilai {num2} USD atau lebih (deposit/pembelian semua jenis mata wang kripto adalah layak, jumlah tersebut akan dikira berdasarkan harga mata wang kripto pada masa deposit/pembelian) akan layak untuk mengambil bahagian dalam cabutan bertuah untuk memenangi kotak misteri yang bernilai sehingga {num3} USDT.",
  "beginnerZone.rule.item4": "4. Pengguna boleh mendeposit atau membeli kripto melalui Beli Segera, P2P, dan bayaran pihak ketiga untuk menyelesaikan tugasan. Sampul Merah dan Dana Percubaan tidak dikira.",
  "beginnerZone.rule.item5": "5. Lengkapkan dagangan pertama anda dan menangi sehingga {num1} USD. Pengguna yang tidak pernah berdagang di {brandName} sebelum acara ini sahaja yang layak. Pengguna yang telah membuat dagangan pertama mereka yang bernilai {num2} USD atau lebih sepanjang acara berlangsung akan layak untuk mengambil bahagian dalam cabutan bertuah untuk memenangi dua kotak misteri yang bernilai sehingga {num3} USD. Volum dagangan yang mempunyai kadar yuran sifar adalah tidak dikira bagi tujuan acara ini.",
  "beginnerZone.rule.item6": "6. Dagangan sah termasuk dagangan niaga hadapan, dagangan semerta, pembelian produk {brandName} Untung, dagangan yang telah dibuat oleh bot dagangan, dan dagangan margin. Nilai akan dikira mengikut jumlah transaksi pada masa penempatan pesanan yang berjaya.",
  "beginnerZone.rule.item7": "7. Ia mungkin terdapat kelewatan dalam pengemasan kini data. Jika data belum dikemas kini, cuba muat semula halaman atau hubungi khidmat pelanggan.",
  "beginnerZone.rule.item8": "8. Ganjaran biasanya akan diterima dalam masa {num} hari, tetapi isu kelewatan mungkin boleh berlaku. Apabila menggunakan Kupon Tolakan Fiat, jumlah tolakan anda akan dikembalikan selepas membuat pesanan.",
  "beginnerZone.rule.item9": "9. Ganjaran dalam kotak misteri mungkin termasuk: Kupon Tolakan Niaga Hadapan, Dana Percubaan Niaga Hadapan, Kupon Naik Kadar, Kupon Tolakan Fiat, Koin Hangat, Kupon Rebat Yuran Dagangan, Bonus Margin, Kupon Tanpa Faedah, dan banyak lagi!",
  "beginnerZone.rule.other": "Peraturan Tambahan",
  "beginnerZone.rule.other.item1": "1. Ganjaran mesti dituntut dalam masa {num} hari, jika tidak, ganjaran tersebut akan tamat tempoh.",
  "beginnerZone.rule.other.item2": "2. Sub-akaun adalah tidak layak untuk acara ini. Deposit yang telah dibuat melalui sub-akaun tidak akan dikira.",
  "beginnerZone.rule.other.item3": "3. Nilai USD bagi deposit dan dagangan sepanjang acara ini berlangsung akan dikira menggunakan kadar pertukaran masa nyata.",
  "beginnerZone.rule.other.item4": "4. {brandName} berhak untuk membatalkan kelayakan dan membatalkan ganjaran mana-mana peserta yang telah didapati terlibat dalam aktiviti penipuan atau menyalahi undang-undang.",
  "beginnerZone.rule.other.item5": "5. {brandName} berhak untuk membatalkan acara ini, mengubah acara ini, atau mengubah peraturan acara ini.",
