  "dVErDKiKeaZrzaSBAFR61B": "Andai kata anda mempunyai <a href='{priceurl}' target='_blank' >USDT</a> sebanyak 1K dan membuat keputusan untuk terlibat dalam dagangan salinan. Anda memilih untuk menyalin pedagang veteran di platform dagangan salinan mata wang kripto. Jika mereka membuat keputusan untuk menggunakan 10% daripada portfolio mereka untuk <a href='{buyurl}' target='_blank' >membeli Bitcoin</a>, akaun anda secara automatiknya memperuntukkan 10% daripada dana anda (100 USDT) untuk membuat pesanan beli yang sama. Begitu juga, jika mereka menjual peratusan <a href='{ethurl}' target='_blank' >Ethereum</a> yang tertentu, akaun anda akan meniru jualan tersebut secara berkadar. Portfolio anda mencerminkan tindakan pedagang yang anda pilih untuk menyalin, mencerminkan pendekatan mereka dalam had pelaburan anda sebanyak 1K USDT.",
