  "etf.action.redeem": "Tebus",
  "etf.action.subscribe": "Langganan",
  "etf.action.toTrade": "Dagang",
  "etf.answer.five.content1": "i. Yuran dagangan: Ia akan dikenakan ketika membeli/menjual token berleveraj di pasar spot. Tahap yuran adalah sama dengan dagangan semerta.",
  "etf.answer.five.content2": "ii. Yuran langganan: Ia akan dikenakan semasa anda melanggan token berleveraj. Pada masa ini, ia adalah {feeRate}% dari setiap langganan.",
  "etf.answer.five.content3": "iii. Yuran penebusan: Ia akan dikenakan semasa anda menebus token berleveraj. Pada masa ini, ia adalah {feeRate}% dari setiap penebusan.",
  "etf.answer.five.content4": "iv. Yuran pengurusan: Ia akan dikenakan pada 07:45 (UTC + 8) setiap hari sebanyak {managementFees}%. Yuran tersebut akan dimasukkan ke dalam nilai aset bersih token berleveraj dan tidak akan mempengaruhi pegangan anda. Sistem akan terus mengenakan yuran pengurusan kepada anda, oleh itu harap berhati-hati apabila memegang token berleveraj dalam jangka masa panjang.",
  "etf.answer.five.tilte": "Bayaran yang dikeluarkan dari Token Berleveraj {brandName} adalah seperti berikut:",
  "etf.answer.one": "Token Berleveraj {brandName} adalah aset yang boleh diperdagangkan di pasaran semerta {brandName} yang memanfaatkan keuntungan apabila buka panjang/buka pendek berbanding aset asas. Contohnya, apabila harga BTC naik 1%, maka BTC3L akan naik sebanyak 3% sedangkan BTC3S akan turun sebanyak 3%. Tidak seperti dagangan margin atau dagangan niaga hadapan, pemegangan token berleveraj tidak memerlukan jaminan atau pemeliharaan margin, dan tidak ada risiko kecairan sama sekali. Walau bagaimanapun, mungkin terdapat kemeruapan yang tinggi dalam harga token berleveraj, oleh itu harap berhati-hati dengan pelaburan anda.",
  "etf.answer.six.content1": "i. Berbanding dengan pasaran semerta, pasaran token berleveraj mempunyai risiko dan ketidakpastian yang lebih tinggi. Token berleveraj boleh membawa banyak keuntungan atau kerugian dalam sehari.",
  "etf.answer.six.content2": "ii. Disebabkan mekanisme imbangan semula dan yuran pengurusan, semakin lama anda memegang token berleveraj, semakin banyak yuran yang perlu anda bayar. Oleh itu, sila berhati-hati apabila memegang token tersebut dalam jangka masa panjang.",
  "etf.answer.step1.content": "Anda boleh dagangkan token berleveraj di pasaran semerta {brandName}. Pergi ke halaman token berleveraj dan cari token pilihan anda, klik 'Dagang' untuk membeli atau menjual.",
  "etf.answer.step1.title": "i. Pasaran {brandName} Semerta (disyorkan)",
  "etf.answer.step2.content": "{brandName} akan memproses permintaan langganan dan penebusan pada jam {unifiedSubmissionTimePoints} setiap hari. Harga langganan / penebusan ditentukan oleh harga pelaksanaan, oleh itu terdapat ketidakpastian sepanjang masa dan harga. Harap berhati-hati dengan keputusan perdagangan anda.",
  "etf.answer.step2.title": "ii. Langganan / Penebusan",
  "etf.answer.three": "Disebabkan mekanisme imbangan semula, Token Berleveraj {brandName} adalah pilihan yang baik untuk pergerakan pasaran satu sisi sedangkan tidak sesuai untuk turun naik pasaran. Apabila terdapat turun naik yang besar, mungkin terdapat lebih banyak kerugian bersih setiap hari, oleh itu harap berhati-hati ketika melabur.",
  "etf.answer.two": "Token Berleveraj {brandName} memang merupakan sebahagian daripada saham dana berleveraj. Pengurus dana akan memastikan bahawa pengembalian dana adalah berdasarkan pada gandaan tertentu dari aset asas dan pedagang dapat memperoleh keuntungan berlipat ganda dari aset asas tersebut. Apabila kemeruapan harga di seberang melebihi ambang, sistem akan memperkenalkan mekanisme imbangan semula untuk melindungi risiko, memastikan kerugian bersih terkawal.",
  "etf.apply.alert": "<div>Pemprosesan harian berlaku pada {unifiedSubmissionTimePoints}. Harga langganan dan penebusan adalah berdasarkan dagangan terakhir yang dilengkapkan. </div> <div>Untuk mengurangkan sebarang risiko atau ketidakpastian, kami mengesyorkan agar anda menggunakan dagangan semerta.</div> <div class='tip'>Harap maklum: Apabila melanggan atau menebus, aset anda akan sentiasa dikreditkan pada masa pemprosesan berjadual yang seterusnya.</div>",
