  "ezfMTJh5atRe4DxV8aHCCB": "<span>Nilai Kecairan Pasaran:</span> Pertimbangkan kecairan pasaran platform. Kecairan yang tinggi memastikan anda boleh melaksanakan dagangan dengan cepat dan pada harga yang hampir dengan kadar pasaran, mengurangkan risiko slippage dan pergerakan harga yang merugikan.",
  "f024f611b7104000afb3": "Permintaan diterima. Keputusan akan dikeluarkan dalam masa 30 saat.",
  "f04f212c6c864000ab3f": "Kami kerap menyandarkan data untuk memastikan pemulihan segera sekiranya berlaku kehilangan atau kerosakan data.",
  "f0c3a38dc9884000a01b": "Auto Untung akan diaktifkan untuk koin baharu yang ditambah ke KuCoin Simpanan.",
  "f13dde558c1e4000a40b": "Keselamatan Sistem",
  "f28d189c4db14000a9ab": "Pembangunan yang Selamat",
  "f2b84adc997e4000a9b4": "Rizab kami adalah diagihkan merentasi dompet sejuk, suam, dan panas, dengan majoriti aset disimpan dalam dompet sejuk yang tidak boleh diakses terus dari internet, dengan itu meminimumkan risiko dan melindungi dana pengguna.",
  "f2e4a9a1d64e4000a1a0": "Sebelumnya:",
  "f3b1d516d30b4000abd0": "Kandungan",
  "f3befe03e4364000a82e": "Pengesahan Berbilang Faktor (MFA) merupakan langkah mudah dan berkesan yang menambah lapisan perlindungan tambahan. Apabila MFA diaktifkan, anda menjalankan jenis pengesahan kedua selain memasukkan nama pengguna dan kata laluan anda.\n\n{brandName} menggunakan beberapa kaedah MFA, termasuk kod pengesahan e-mel, kod pesanan teks, dan Google Authenticator. Selain itu, aplikasi kami menawarkan pilihan pengesahan biometrik, seperti cap jari dan pengecaman muka, untuk mengesahkan identiti anda dengan segera dan selamat.\n\nJika keselamatan sistem mengesan anomali yang ketara dalam peranti dan alamat IP yang digunakan untuk log masuk ke akaun anda, atau jika ia menganggap tindakan anda baru-baru ini berisiko kepada keselamatan akaun anda, pautan e-mel akan digunakan untuk mengukuhkan lagi pengesahan. Ini membantu menghalang pelanggaran akaun daripada serangan pancingan data, penipuan telekomunikasi, dan pelbagai ancaman lain.",
  "f47b94ef147c4000a250": "Tersedia + Dilaburkan (USDT)",
  "f5B3R5EgXkkHdXBGHyJ8Rm": "Masukkan UID",
  "f5Zge54Cj2Ntd1RrAMMfCG": "Perlombongan kripto adalah penting untuk rangkaian blok rantai, dan ia menggunakan kedua-dua perkakasan dan perisian untuk menyelesaikan masalah matematik untuk memberi ganjaran kepada pelombong dalam mata wang kripto. Dalam panduan ini, fahami faedah, risiko, jenis, dan keuntungan perlombongan awan, serta cara untuk mencegah penipuan.",
  "f6a0c27b7fe04000a1e2": "{brandName} menggunakan WAF (firewall aplikasi web) untuk memintas dan melindungi aplikasi utama daripada pelbagai jenis serangan aplikasi web.",
  "f6c3cbe6a2ef4000a8f1": "1. Sistem membantu anda melanggan produk Simpanan untuk mata wang pilihan anda dengan baki yang tersedia dalam Akaun Pendanaan anda. Dilakukan setiap hari pada jam 09:00 (UTC+8).",
  "f6fe83efb3fe4000a80e": "Frasa anti-pancingan data membantu mencegah serangan pancingan data. Kod ini boleh ditetapkan dalam tetapan e-mel, log masuk, dan pengeluaran anda. Dengan menyemak sama ada kod dipaparkan semasa log masuk, pengguna boleh mengesahkan sama ada laman web tersebut adalah laman tulen atau pancingan data. Jika laman pancingan data disyaki, anda harus keluar dari laman tersebut dengan serta-merta dan mengubah tetapan keselamatan anda untuk memastikan akaun anda selamat.",
  "f919f92814284000a58e": "Pengasingan Data Sensitif dengan Pangkalan Data Khusus dan Kontena",
  "f9bea9fe0aa84000a87c": "Kadar faedah: {coin1} pada {apr1}, {coin2} pada {apr2}, dan {coin3} pada {apr3}.",
