  "fKfoegsqTyeALZAXupFD3u": "Pengagihan Ganjaran Blok",
  "fL7UnR7fGBuBmBj9ptbD76": "Pro",
  "fLqeckfJ16QX33Q7skx1Ch": "Sudah ada alamat {coin} dengan catatan yang sama. Beri perhatian terhadap perbezaan apabila mengguna.",
  "fPoz13ans9Sg2oT2t2JU6z": "Pengeluaran dibekukan",
  "fQjMAkUAQSfPs29m44gwYz": "<span>Amal, Belajar, dan Urus Jangkaan:</span> Mulakan dengan akaun demo sebagai alat pembelajaran dagangan salinan. Gunakannya sebagai peluang untuk mengetahui tentang trend pasaran, memahami bahawa dagangan melibatkan risiko, dan menguruskan jangkaan anda dengan sewajarnya. Berhati-hati dengan sebarang kos yang berkaitan, dan berinteraksi dengan komuniti platform untuk mendapatkan pandangan dan pengalaman yang dikongsi.",
  "fQpHhmPrNjBjUC7CXtWzps": "klik di sini untuk menghantar semula.",
  "fRZbnDHRT6v7UEKnj6JBjh": "<span>Kerap Kemas Kini Dompet Anda:</span> Mengemas kini perisian dompet anda memastikan anda mempunyai patch dan penyelesaian keselamatan terkini untuk kelemahan yang diketahui.",
