  "kuscePzaNqgkKXGTZFHkWw": "(1) Sekiranya baki yang tersedia dalam akaun anda adalah mencukupi untuk menampung tolakan sementara yang diperlukan:\n\nAnda boleh menunggu blok rantai untuk mengesahkan semula deposit anda. Sebaik sahaja deposit anda disahkan semula, baki akaun anda akan dikemas kini dan dipulihkan, dan kami akan memaklumkan anda.<br/>\n\n(2) Sekiranya baki yang tersedia dalam akaun anda adalah tidak mencukupi untuk menampung tolakan sementara yang diperlukan:\n\nAktiviti dagangan anda mungkin terjejas. Anda boleh mengikuti arahan dan memindahkan aset ke dalam Akaun Pendanaan anda untuk menampung jumlah terhutang. Kemudian, <a href='{serviceLink}'>hubungi khidmat pelanggan</a> untuk memproses tolakan sementara tersebut.",
