  "aboutus.roadmap.2024.q1": "<p><b>KuCard x Apple Pay</b>: Kad kripto Visa {brandName} kini menyokong Apple Pay</p><p><b>Kepimpinan Pengawalseliaan di India</b>: {brandName} menerajui pematuhan FIU dalam kalangan bursa kripto global</p><p>{brandName} melancarkan <b>Martingale Niaga Hadapan</b>, strategi bot dagangan niaga hadapan baharu</p>",
  "aboutus.roadmap.2024.q2": "<p>{brandName} melancarkan GemSlot dan GemPool untuk penyenaraian token</p><p>{brandName} melancarkan <b>Trend Niaga Hadapan AI</b>, strategi bot dagangan niaga hadapan baharu</p><p>{brandName} Niaga Hadapan memperkenalkan pesanan had lanjutan, memberikan pengguna fleksibiliti dagangan yang lebih besar</p>",
  "aboutus.roadmap.2024.q3": "<p>{brandName} meraikan ulang tahun ke-7: \"7akinlah {brandName}, Miliki Masa Hadapan Anda\"</p><p>{brandName} Niaga Hadapan memperkenalkan <b>Margin Silang</b>, meningkatkan kecekapan modal</p><p><b>Auto-Untung</b>: Satu ciri untuk melanggan dana yang tidak digunakan dengan mudah ke Simpanan Fleksibel untuk mendapatkan pulangan yang stabil</p><p><b>Untung Pintar</b>: Alat {brandName} Untung yang menawarkan pengesyoran yang disesuaikan berdasarkan pilihan dan tahap risiko</p><p><b>Penaiktarafan Bot Dagangan</b>: UI yang diubah suai dan mod bot dagangan baharu, menampilkan 12 strategi automatik untuk keadaan pasaran yang pelbagai</p><p></p>",
  "aboutus.roadmap.2024.q4": "<p>{brandName} melancarkan <b>Dagangan Opsyen</b> lanjutan, memperluas strategi dagangan dan alat pengurusan risiko</p><p>{brandName} melancarkan <b>Faedah Niaga Hadapan</b>, antara muka khusus yang mempunyai promosi eksklusif untuk pedagang niaga hadapan</p><p>{brandName} melancarkan <b>Dagangan Salinan Niaga Hadapan</b>, membolehkan penggambaran strategi masa nyata dengan menyepadukan dagangan pedagang lead</p><p><b>Berita Terkini</b>: Suapan berita berkuasa AI untuk maklumat pasaran yang lebih pintar</p><p><b>Penyelidikan {brandName}</b>: Pusat sumber baharu untuk analisis industri dan laporan projek</p><p><b>{brandName} Belajar dan Untung</b>: Cara yang interaktif untuk memperoleh kripto percuma melalui pembelajaran</p>",
  "aboutus.roadmap.2025.q1": "<p><b>{brandName} Pay</b>: Penyelesaian saudagar untuk pembayaran kripto yang lancar</p><p><b>Berita {brandName}</b>: Maklumat terkini pasaran masa nyata mengenai perkembangan Bitcoin, altcoin, dan Web3</p>",
