  "bca93a8787b24000a4c8": "Kebenaran dagangan untuk sub-akaun ini belum diaktifkan. Log masuk ke akaun induk anda untuk mengedit kebenaran sub-akaun.",
  "02088f2422e94000a3eb": "Infrastruktur terdesentralisasi",
  "026968b084d24000a02b": "Faedah Ekosistem KCS",
  "05e3c1d361f74000abe8": "Metaverse permainan sosial",
  "087f119ac6bd4000aa0d": "TRGC merupakan dana aset digital khusus untuk melabur dalam peluang transformasi yang memacu anjakan paradigma internet yang seterusnya.",
  "0df6bb1fff2e4000af72": "Nikmati yuran yang lebih rendah, ganjaran eksklusif, dan pertaruhan langsung dalam masa hadapan KuCoin melalui ekosistem KCS kami yang berkembang maju.",
  "185af89739e74000aace": "Sertai komuniti global dinamik yang berkembang maju dalam kerjasama, inovasi, dan rangkuman kewangan.",
  "23a3d14b6cf34000a882": "Hubungi kami.",
  "24e8b825a97b4000a553": "Kelebihan Kami",
  "288ee3f258534000a134": "KuCoin Ventures melabur dalam dan menyokong projek blok rantai yang inovatif merentas sektor seperti infrastruktur, DeFi, NFT, dan SocialFi, memacu perkembangan ekosistem Web3 yang berterusan.",
  "2bc2d33b535b4000ac09": "Kami sentiasa berkembang untuk memenuhi keperluan pedagang moden, menawarkan alat yang canggih dan pengalaman dagangan yang lancar.",
  "2ecd9e9b835f4000af50": "Infrastruktur saling kendali Web3",
  "3a1d43481cdb4000a587": "E-mel",
  "3ccc4f64a7ab4000a0e2": "Sebagai pelabur yang memberi tumpuan kepada komuniti dan dipacu oleh penyelidikan, KuCoin Ventures bekerjasama rapat dengan projek portfolionya sepanjang seluruh kitaran hayat mereka, mengkhusus dalam infrastruktur DeFi, GameFi, dan Web3.",
  "3ced5ea1db9f4000af5b": "ZK-rollup yang terdesentralisasi dan setara dengan Ethereum",
  "4e0b5341981e4000a9af": "Keselamatan Didahulukan",
  "581fedf360194000a8ec": "OS terdesentralisasi",
  "59faeed1a8cf4000a094": "Abstraksi rantai tanpa dompet L1",
  "5bd44eada21d4000ae67": "KuCoin Ventures menyokong pembina kripto dan Web3 dari segi kewangan dan strategik, menawarkan pandangan yang mendalam dan memanfaatkan sumber global",
  "5d01bcc193c54000a0c1": "Lihat Jawatan Kosong",
  "5d0321509ade4000afe7": "Bursa terdesentralisasi semua-dalam-satu",
  "5eedfcd04c8e4000a152": "Dagangan Inovatif",
  "639afd5beda54000a272": "Berganding Bahu Membentuk Masa Hadapan",
  "64f878358ab64000a8d0": "Inkubator Web3",
  "67f9cb69ac0e4000a169": "Sertai KuCoin dan jadi sebahagian daripada masa hadapan yang dibina berdasarkan ketelusan, integriti, dan semangat.",
  "6a1ac3fe9f8f4000ab62": "Untuk menjadi sebuah syarikat teknologi yang disanjungi di seluruh dunia, memacu inovasi dalam industri kripto.",
  "6ea33259dec64000a53d": "Sistem sosial Web3",
  "7524379504f44000ac34": "Membolehkan <span class='hl-text'>aliran bebas <br/>nilai digital di seluruh dunia</span>",
  "7762b1cabbcf4000a1cd": "Keselamatan anda adalah keutamaan kami. Kami melindungi aset anda dengan perlindungan yang terkemuka dalam industri, memastikan ketenangan fikiran yang sepenuhnya.",
  "7b43d074282b4000a338": "Semuanya bermula dengan Michael, seorang pengekod bersemangat yang memulakan pengaturcaraan pada umur hanya 8 tahun dan melancarkan syarikat pertamanya pada umur 16 tahun. Pada tahun 2012, beliau mengetahui Bitcoin melalui majikannya, Eric, dan mereka berdua melibatkan diri dalam dunia perlombongan dengan penuh minat. Walau bagaimanapun, apabila Michael cuba menjual beberapa BTC di Mt. Gox—bursa terbesar ketika itu—beliau segera menyedari betapa sukar dan tidak boleh diaksesnya dagangan kripto bagi pendatang baharu, meskipun ia amat berpotensi untuk membentuk semula landskap kewangan.",
  "7d7838da36ea4000a98c": "Kedai aplikasi kripto berbilang rantai Web3",
  "7fa0d0df97424000a257": "Blok rantai yang dioptimumkan untuk para gamer",
  "86f4b83859364000aaa7": "Aplikasi SocialFi",
  "8891a013712e4000a472": "Apabila kadar penggunaan blok rantai meningkat, Michael dan Eric mengenal pasti kuasa transformasinya—bukan untuk golongan kaya sahaja, tetapi untuk semua individu—termasuk golongan yang tidak mempunyai akaun bank dan kurang mendapat perkhidmatan. Pada akhir tahun 2013, mereka duduk di sebuah kafe dan menulis baris kod pertama untuk apa yang bakal menjadi KuCoin—Bursa Rakyat, sebuah platform yang direka bentuk untuk meruntuhkan halangan dan menjadikan kripto boleh diakses oleh semua.",
  "8eb597d442274000a1ee": "Pasaran wang ekosistem SUI",
  "931d0a8829fa4000aab0": "Untuk meningkatkan kadar penggunaan blok rantai dan mata wang kripto dengan membolehkan aliran bebas nilai digital di seluruh dunia.",
  "9adf29707ebc4000a467": "Misi",
  "a23f71374c5e4000a362": "Cabang pelaburan terkemuka Bursa KuCoin",
  "a4d0df02a97f4000a741": "Bursa hasil pulangan sintetik berleveraj",
  "b64124e449ee4000a742": "Penerbit dan pembangun permainan play-and-earn lintas platform",
  "b84161bcdd5e4000a70b": "Kisah Kami",
  "babf517cd7614000a650": "KuCoin Ventures bekerjasama dengan dana pelaburan terkemuka untuk menyokong projek blok rantai yang inovatif, memupuk perkembangan dalam ekosistem Web3 dan kripto.",
  "c10b4e0fdd304000ab1d": "Memperkasakan <span class=\"web3\">Web3</span> & <span class=\"tech\">Teknologi Generasi Akan Datang</span>",
  "c25f2a1fc8ad4000a4ed": "Dana venture yang mengkhusus dalam pelaburan kripto peringkat awal di seluruh dunia.",
  "c44b0e64e2ac4000a85b": "Protokol kecairan terdesentralisasi di SUI",
  "c979d478b8ab4000a0c8": "Pemerkasaan Global",
  "d637b3a566894000a742": "Dana Venture",
  "d7bcc8e004234000ac88": "Rangkaian ZK-RaaS terdesentralisasi",
  "e0bdc1ffdeaf4000aed7": "KuCoin telah ditubuhkan oleh dua orang peminat teknologi, yang mempunyai visi untuk menjadikan mata wang kripto boleh diakses oleh semua individu, yang mengenal pasti potensi blok rantai sejak awal.",
  "e2fd47cd88394000a1c3": "Mohon Sekarang",
  "e354f44e68584000aafa": "Infrastruktur pengkomputeran terdesentralisasi",
  "f0f30111507d4000aa73": "Portfolio Kami",
  "f273ff4318a74000ac49": "KuCoin Ventures komited untuk melabur dalam projek kripto dan blok rantai yang paling inovatif yang membentuk era Web3.",
  "f44dd159465f4000a8c0": "NFT cip biru yang paling terkenal",
  "f4857287756d4000affb": "KuCoin merupakan sebuah bursa kripto global yang terkemuka, diyakini oleh lebih daripada 40 juta pengguna merentas 200+ buah negara. Kami menyediakan dagangan semerta, margin, opsyen, dan niaga hadapan kekal, berserta dengan perkhidmatan DeFi, beri pinjaman, dan perlombongan.",
  "f5cfd00af36a4000a820": "Visi",
  "f613f66566a54000acf4": "Pengagregat hasil pulangan kompaun automatik",
  "6ad997ad569f4000a532": "Pengurus aset institusi yang memberi tumpuan secara eksklusif kepada blok rantai dan aset digital, melabur merentas rantaian awam, protokol, aplikasi, dan penyedia kewangan kripto.",
  "d16b36fbb31b4000a406": "atau",
  "8a8d43d3bb784000a2ad": "1. Centralized SSL/TLS certificate lifecycle management\n2. User data transmissions are protected via HTTPS, supporting the most advanced security protocols and blocking weak cryptographic ciphers",
  "f2966969ff594800a7a2": "Frequent testing and assessments are conducted throughout the development lifecycle to secure our code, certificates, and communications.\n1. Code Scanning: Static Vulnerability Assessments (SVA) and Dynamic Vulnerability Assessments (DVA) are done in conjunction with shift-left security practices.\n2. SSL/TLS Certificate Management: Standardized and centralized full lifecycle management protects the integrity of SSL/TLS certificates.\n3. Data Transmission: User data is protected via HTTPS, supporting the most advanced security protocols and blocking weak cryptographic ciphers.",
  "application.tipDialog.goOn": "Teruskan",
